function farmaciaTemporal(cID, nit, cli, dir, tel, uid, zid) {
var db = window.openDatabase("markdisdb", "1.0", "Cordova Demo", 200000);
db.transaction(function temporal(tx) {
tx.executeSql('DROP TABLE IF EXISTS farmaciaTemporal');
tx.executeSql('CREATE TABLE IF NOT EXISTS farmaciaTemporal (CLIENTEID unique, NIT, CLIENTE, DIRECCION, TELEFONO, USERID, ZONAID)');
tx.executeSql('INSERT INTO farmaciaTemporal (CLIENTEID, NIT, CLIENTE, DIRECCION, TELEFONO, USERID, ZONAID) VALUES ("'+cID+'","'+nit+'","'+cli+'","'+dir+'","'+tel+'","'+uid+'","'+zid+'")');
}, errorCB);
}
